@permagrinfilms Climbing up the tip top of the Transamerica building in San Francisco. "Only with the approval of the building owners where we allowed to go to the very top (We were doing some timelapse work for them). At the top was a guest registry book that had about 2 dozen names on it. We signed our names after taking in some amazing views and couldn't help but feel lucky:)". Make sure you follow @permagrinfilms for some of the best #gopro  footage out there. 
